// Unix Signal manager:
struct ___CONTEXT *top_context;

void interrupt_signal(int sig)  
{                               
  stack_print(top_context);     
  print_string("User interrupt.\n"); 
  die_with_code(1);                     
}                                       

int push(struct ___CONTEXT *context, struct ___CONTEXT *back, unsigned long code)
{
  if (context != back) {  
    top_context   = context; 
    context->code = code;   
    context->back = back;   
  }; 
} 
  
int stack_print(struct ___CONTEXT *up)       
{ struct ___CONTEXT *back,*next;             
  next = NULL;                               
  while (up != NULL) {                       
    back = up -> back;                       
    up -> back = next;                       
    next = up;                               
    up = back;                               
  };                                         
  print_string("\n============== BOTTOM ==============\n"); 
  while (next != NULL) {                     
    print_string("Line #");                
    print_integer(next->code >> 17);         
    print_string(" Column #");             
    print_integer((next->code >> 9) & 0xFF); 
    print_string(" in ");                  
    print_string(trace[next->code & 0x1FF]); 
    print_string(".\n");                  
    next = next -> back;                     
  };                                         
  print_string("================ TOP ===============\n"); 
}                                            
 
int print_string(char *str) 
{ 
  while (*str!=0) {
    print_char(*str); 
    str++; 
  };
}  
 
int print_integer(unsigned short n) 
{ unsigned short d,r;
  d = 10000; 
  while (d!=0) {
    r = n / d; 
    print_char(r + '0'); 
    n = n % d; 
    d = d / 10; 
  }; 
} 

